import "./daw.css"
export const SongEditor = (props) => {
  if(props.current){
    let tracks = props.current.data
    return <div className="grid-container">
    <div>Logo</div>
    <div>Settings</div>
    <div><TrackSelector tracks={tracks} /></div>
    <div>content area</div>
    </div>
  } else {
    return "no parents"
  }
}

const TrackSelector = (props) => {
  let tracks = props.tracks.map((item, idx) => {
    return <div key={idx}>{item.notes.length}</div>//.notes.length
  })

  return tracks
}
